import React, { useEffect } from "react";
import ReactDOM from "react-dom";
import "./styles/styles.scss";
import App from "./App";
import Aos from "aos";
import "aos/dist/aos.css";

useEffect(() => {
  Aos.init({ duration: 200 });
});

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
